$(document).ready(function() {
	log("Document loaded");

	worldmap();

	if (window.WebSocket) {
		log("WS supported");
		initConnection();
	} else {
		log("WS not supported");
		$("#error").show();
	}
});

var resizeTimer;
$(window).resize(function() {
	clearTimeout(resizeTimer);
	resizeTimer = setTimeout(redraw, 100);
})

function redraw() {
	paper.remove();
	worldmap();
};

var debug = false;
var tweetCount = 0;
var maxLength = 20;

var intervalSeconds = 5;
var seconds = 0;

var interval;

function log(message) {
	if (debug) {
		console.log(message);
	}
}

function updateTweetSpeed() {

	var speed = 0;

	if (tweetCount > 0) {
		seconds += intervalSeconds;

		var hours = seconds / 3600;
		speed = Math.round(tweetCount / hours);
	}

	$("#tweet_speed").text(speed);
}

function initConnection() {

	var loc = window.location;
	var wsUrl = "ws://" + loc.hostname;
	if (loc.port != 80 && loc.port != 443) {
		wsUrl += ":" + loc.port;
	}
	wsUrl += loc.pathname + "ws";

	var ws = new WebSocket(wsUrl);
	ws.onopen = function() {
		log("WS connection opened");
		updateTweetSpeed();
		interval = setInterval(function() {
			updateTweetSpeed();
		}, intervalSeconds * 1000);
	};
	ws.onmessage = function(evt) {
		var msg = JSON.parse(evt.data);
		log("WS message received: " + evt.data);
		if (msg.action == "INFO") {
			updateFollowers(msg.info);
		} else if (msg.action == "TWEET") {
			plotTweet(msg.tweet);
			addTweet(msg.tweet);
		}
	};
	ws.onclose = function() {
		log("WS connection closed");
		clearInterval(interval);
		disconnect();
		setTimeout(function() {
			initConnection();
		}, 60000);
	};
}

