function get_xy(lat, lng) {
	var mapWidth = 2058;
	var mapHeight = 1746;
	var factor = .404;
	var x_adj = -391;
	var y_adj = 37;
	var x = (mapWidth * (180 + lng) / 360) % mapWidth + (mapWidth / 2);
	var latRad = lat * Math.PI / 180;
	var mercN = Math.log(Math.tan((Math.PI / 4) + (latRad / 2)));
	var y = (mapHeight / 2) - (mapWidth * mercN / (2 * Math.PI));
	return {
		x : x * factor + x_adj,
		y : y * factor + y_adj
	}
}

function plotTweet(tweet) {
	tweetCount++;
	$("#tweet_count").text(tweetCount);

	var xy = get_xy(tweet.lat, tweet.long);
	var loc_obj = paper.circle(xy.x, xy.y, 5);
	loc_obj.scale(scale, scale, 0, 0);
	loc_obj.attr("fill", "#FF0000");
	loc_obj.attr("stroke", "#FFFFFF");
	loc_obj.attr("stroke-width", 1);
	loc_obj.attr("opacity", 0);
	loc_obj.x = xy.x;
	loc_obj.y = xy.y;

	// Fade in
	fadeIn(loc_obj);

	// Grow the array only to maxLength
	if (location_set.length > maxLength) {
		var item = location_set.items.splice(0, 1);

		// Fade out
		fadeOut(item[0]);
	}
}

function updateFollowers(info) {
	$("#user_count").text(info.user_count);
}

// Fade in
function fadeIn(item) {
	item.animate({
		opacity : 1
	}, 1000, function() {
		location_set.push(this)
	});
}

// Fade out
function fadeOut(item) {
	item.animate({
		opacity : 0
	}, 1000, function() {
		this.remove()
	});
}

function disconnect() {
	$("#user_count").text("-");
	$("#tweet_speed").text("-");
}

function addTweet(data) {
	var tweets = $("#tweets");

	// Tweet container
	var tweet = $("<div/>");
	tweet.attr("v", 1);
	tweet.addClass("row");
	tweet.hide();

	var pictureContainer = $("<div/>");
	pictureContainer.addClass("one column");
	pictureContainer.appendTo(tweet);

	var textContainer = $("<div/>");
	textContainer.addClass("eleven columns");
	textContainer.appendTo(tweet);

	var image = $("<img/>");
	image.attr("src", data.picture);
	image.addClass("image");
	image.appendTo(pictureContainer);

	var nameRow = $("<div/>");
	nameRow.addClass("row");
	nameRow.appendTo(textContainer);

	var screenName = $("<a/>");
	screenName.attr("href", "https://twitter.com/" + data.screen_name);
	screenName.text(data.display_name);
	screenName.appendTo(nameRow);

	var tweetRow = $("<div/>");
	tweetRow.addClass("row");
	tweetRow.text(data.message);
	tweetRow.appendTo(textContainer);

	tweets.prepend(tweet);
	tweet.fadeIn("slow");

	// Show only maxLength tweets
	var children = $("#tweets div[v='1']");
	var overLimit = children.length - maxLength;
	if (overLimit > 0) {
		var removed = children.slice(-overLimit);
		removed.attr("v", 0);
		removed.fadeOut("slow", function() {
			this.remove()
		});
	}
}